// src/components/Contact.js
import React from 'react';
import './Contact.css';

 
const Contact = () => {
  return (
    <section className="contact" id='contact' >
      <h2>Contact Me</h2>
      <p>Email me at: <a href="mailto:example@email.com">example@email.com</a></p>
      </section>
  );
};

export default Contact;
